#
# Description: This script computes the batch size that optimizes the average waiting time it takes for requests to be completed, 
#   along with this optimal average waiting time. The batch accelerator is assumed to implement the algoritm 'alg', 
#   which is one of: kybenc2, kybenc3, kybenc4, kybdec2, kybdec3, kybdec4, dilsig3, dilver3. It is also assumed to have 'c' parallel 
#   processing elements, and requests arrive at a rate of 'lab' requests per second. The queue follows the model by Sim and Templeton,
#   and  the computation follows from their work [ST85].
#   * alg: the accelerated algorithm (options: kybenc2, kybenc3, kybenc4, kybdec2, kybdec3, kybdec4, dilsig3, dilver3)
#   * c: number of parallel processing elements in the accelerator
#   * lam: rate of requests per second
#   This script returns a tuple [b,time] consisting of the batch size (in the considered range 1-1000/1500) that that optimizes the 
#   average waiting time it takes for requests to be completed, along with this optimal average waiting time. Results are output both
#   in stdout and in the file 'optimal_batch_size.out'.

import argparse
from argparse import RawDescriptionHelpFormatter
from utils import *
import mpmath

#compute_waiting_time: Computes the average waiting time of the M/M(a,b)/c queue model, with lam-Poisson arrivals, mu-negative exp service time, min batch size a, max batch size b, and c processing elements, as per the work of Sim and Templeton [ST85].
def compute_waiting_time(lam,mu,a,b,c): 
    A = [['empty']*(a) for i in range(c+1)]
    P = [['empty']*(a) for i in range(c+1)]
    A[0][0] = 1
    xi = mpmath.findroot(lambda x: lam-(lam+c*mu)*x+c*mu*x**(b+1), lam/(lam+c*mu), tol=2**(-130), verify=True, solver='newton') #eq 8
    if(xi>=1 or xi<=0 or c*b<=lam/mu):
        print('ERROR compute_waiting_time: lam='+str(lam)+", mu="+str(mu)+", a="+str(a)+", b="+str(b)+", c="+str(c)+", xi="+str(xi))
        return -1
    for j in range(1,a):
        A[0][j] = xi**j #eq7
    A[1][a-1] = c*mu*(1-xi**a)/(lam*(1-xi)) #eq9
    for m in range(1,c):
        A[m][0] = ((lam/(lam+(c-m)*mu))**(1-a))*A[m][a-1]-(((c-m+1)*mu)/(lam+(c-m)*mu))*sum([((lam/(lam+(c-m)*mu))**(-r))*A[m-1][r] for r in range(1,a)]) #eq11
        for j in range(1,a-1):
            A[m][j] = ((lam/(lam+(c-m)*mu))**j)*A[m][0]+(((c-m+1)*mu)/(lam+(c-m)*mu))*sum([((lam/(lam+(c-m)*mu))**(j-r))*A[m-1][r] for r in range(1,j+1)])  #eq10
        A[m+1][a-1] = ((lam/(lam+(c-m)*mu))**(-1))*A[m][0]-(((c-m+1)*mu)/lam)*A[m-1][0] #eq12
    A[c][0] = (mu/lam)*A[c-1][0]  #eq 13
    for j in range(1,a-1):
        A[c][j] = A[c][0]+(mu/lam)*sum([A[c-1][r] for r in range(1,j+1)]) #eq10
    P[0][0] = ((1/(1-xi))+sum([sum([A[m][j] for j in range(1,a)]) for m in range(1,c+1)]))**(-1)
    for m in range(c+1):
        for j in range(1,a):
            P[m][j] = A[m][j]*P[0][0]
    D=(1/a)*(1-(lam-(lam+c*mu)*xi+c*mu*xi**(a+1))*P[0][0]/(lam*(1-xi)**2))
    return (D/(2*lam))*a*(a-1)+(xi/(lam*(1-xi)**2))*(1-c*mu*xi/(lam*(1-xi))+(c*mu*xi**a)*(a-(a-1)*xi)/(lam*(1-xi)))*P[0][0] #E(W)

#compute_wait_and_proc_time: Computes the total waiting time, which is waiting time given by the previous routine plus the processing time, controlling that the waiting time can be computed.
def compute_wait_and_proc_time(lam,mu,b,c,alg): 
    if(c*b<=lam/mu): #if this condition is satisfied, then the rate of arrival lambda is too big for the accelerator to handle (avg. waiting time infty).
        return -1 # waiting time -1 means error of some sort.
    return compute_waiting_time(lam,mu,b,b,c)+1/mu #return total waiting time, which is the time in queue plus service time 1/mu.

