#main: Point of execution of the script. This function defines the argument parser, computes
#  output from the provided arguments, and prints the output to stout and to file.
def main():
    # Define argument parser, and input arguments
    parser = argparse.ArgumentParser(description='This script computes the batch size, among batch sizes between 1-1000/1500, that optimizes the average \nwaiting time it takes for requests to be completed, along with this optimal average waiting time in us. \nThe batch accelerator is assumed to implement the algoritm \'alg\',¡ and to have \'c\' parallel processing \nelements, and requests arrive at a rate of \'lam\' requests per second. \n\nexample: \n  py optimal_batch_size.py kybdec4 1 100',formatter_class=RawDescriptionHelpFormatter)
    parser.add_argument('alg', metavar='alg', type=str, help='the accelerated algorithm \n(options: kybenc2, kybenc3, kybenc4, kybdec2, kybdec3, kybdec4, dilsig3, dilver3)')
    parser.add_argument('c', metavar='c', type=int, help='number of parallel processing elements in the accelerator')
    parser.add_argument('lam', metavar='lam', type=int, help='rate of requests per second')
    parser.usage = parser.format_help()
    # Retrieve arguments from parser
    args = parser.parse_args()
    # Compute the result, and print it to stout and to file
    result = optim_batch_size_wrt_avg_time(args.alg,args.c,args.lam)
    print(result)
    f = open('optimal_batch_size.out','w')
    f.write("(alg="+str(args.alg)+", c="+str(args.c)+
      ", lam="+str(args.lam)+
      ") -> [b,time]="+str(result)+
      "\n")
    f.flush()
    f.close()

if __name__ == "__main__":
    main()
